template<typename T> inline bool chkmax(T &a, T b) { return a < b ? a = b, true : false; }
template<typename T> inline bool chkmin(T &a, T b) { return a > b ? a = b, true : false; }
const ll MAXN = 2504;
const ll MAXK = 7;
const ll MAXC = 6;
const ll INF = 1ULL<<60ULL;
const ll MAXF = (MAXN/2) - 1;
const ll base = MAXF;
// f(position,k used,color of fly, fly+BASE)
ll f[2][MAXK][MAXC][MAXN];
ll gklim;
void reset(ll ic) {
	for (ll k=0;k<=gklim;k++) {
		for (ll c=0;c<MAXC;c++) {
			for (ll fly=-MAXF;fly<=MAXF;fly++) {
				f[ic][k][c][base+fly] = INF;
			}
		}
	}
}
class BearPairs {
	public:
	int minCost(string s, vector <int> cost, int klim) {
		gklim=klim;
		ll n=s.length();
		reset(0);
		f[0][0][0][base+0] = 0;
		ll lastia=0;
		for (ll pos=0;pos<n;pos++) {
			ll x = s[pos]-'a';
			ll ic = pos%2;
			ll ia = (pos+1)%2;
			lastia=ia;
			reset(ia);
			for (ll k=0;k<=klim;k++) {
				for (ll c=0;c<MAXC;c++) {
					for (ll fly=1;fly<=MAXF;fly++) {
						ll val = f[ic][k][c][base+fly];
						if (val >=INF) continue;
						for (ll y=0;y<MAXC;y++) {
							if (y==c) continue;
							chkmin(f[ic][k][y][base-fly],val);
						}
					}
				}
			}
			for (ll k=0;k<=klim;k++) {
				for (ll c=0;c<MAXC;c++) {
					for (ll fly=-MAXF;fly<=MAXF;fly++) {
						ll valskip = f[ic][k][c][base+fly]+100*abs(fly);
						if (valskip >= INF) continue;
						{
							// skip
							if (k<klim) {
								chkmin(f[ia][k+1][c][base+fly], valskip);
							}
						}
						ll val = valskip+cost[pos];
						{
							// absorb
							if (fly>0&&x!=c) {
								chkmin(f[ia][k][c][base+fly-1],val);
							}
							if (fly<0&&x==c) {
								chkmin(f[ia][k][c][base+fly+1],val);
							}
						}
						{
							// release
							if (fly==0) {
								// Net +x
								chkmin(f[ia][k][x][base+fly+1],val);
								for (ll y=0;y<MAXC;y++) {
									// Deficit -y
									if (y==x) continue;
									chkmin(f[ia][k][y][base+fly-1],val);
								}
							}
							else {
								if (c==x) {
									// Net +x
									chkmin(f[ia][k][c][base+fly+1],val);
								}
								else {
									// Deficit -c
									chkmin(f[ia][k][c][base+fly-1],val);
								}
							}
						}
					}
				}
			}
		}
		{
			ll final=INF;
			for (ll k=0;k<=klim;k++) {
				for (ll c=0;c<MAXC;c++) {
					final = min(final, f[lastia][k][c][base+0]);
				}
			}
			if (final>=INF) return -1;
			return final;
		}
	}
};
